import React from "react";
import AdminDashboardForAll from "../AdminDashboardForAll";

const Book = () =>{
    return(
        <>
            <section className="admin-global-view-section">
                <section>
                    <AdminDashboardForAll/>
                </section>
                <section>
                    <div className="container">
                        <div className="row">
                            <div className="col-md-12">
                                Books
                            </div>
                        </div>
                    </div>
                </section>
            </section>
        </>
    );
}
export default Book;
